B.Qy=new A.cH("El pueblo fue oficialmente fundado el 29 de septiembre de 1900, en coincidencia con el gobierno del Dr. D\xe1maso E. Palacio. El trazado del pueblo aprovech\xf3 el impulso del ferrocarril, y su nombre rend\xeda homenaje a los primeros pobladores que supieron convertir un paraje inh\xf3spito en un n\xfacleo productivo y organizado.",null,B.cv,B.am,null,null,null,null,null)
B.Qz=new A.cH("La inauguraci\xf3n de la estaci\xf3n ferroviaria \u2014llamada Estaci\xf3n Herrera\u2014 marc\xf3 un antes y un despu\xe9s. En pocos a\xf1os, se establecieron instituciones clave como la Seccional Policial N.\xba 3 en 1891 (cuyo primer comandante fue Zacar\xedas Herrera, hijo de don Jos\xe9) y, en 1896, la escuela primaria \u201cAmancio Alcorta\u201d, que reflejaba el inter\xe9s por la educaci\xf3n de la comunidad naciente.",null,B.cv,B.am,null,null,null,null,null)
B.QB=new A.cH("La cultura en Herrera siempre tuvo un lugar central. La devoci\xf3n al Se\xf1or de los Milagros en Mail\xedn \u2014muy ligada tambi\xe9n a la familia Herrera\u2014 convirti\xf3 al pueblo en un centro de espiritualidad. Las fiestas religiosas, las celebraciones populares y la poes\xeda local fortalecieron una identidad cultural rica y particular.",null,B.cv,B.am,null,null,null,null,null)
