B.QG=new A.cH("En el sur de Santiago del Estero, en la vasta regi\xf3n del departamento Avellaneda, se encuentra la localidad de Herrera, cuya historia est\xe1 profundamente arraigada a los movimientos de colonizaci\xf3n, expansi\xf3n ferroviaria y consolidaci\xf3n cultural de la provincia. El origen de Herrera se remonta al siglo XIX, cuando don Jos\xe9 de la Cruz Herrera, con ideales profundamente ligados a la evangelizaci\xf3n y al trabajo rural, fund\xf3 la estancia \u201cCejas\u201d. Esta estancia se ubic\xf3 estrat\xe9gicamente cerca de lo que se conoc\xeda como el fort\xedn militar de \u201cEl Bracho\u201d, una regi\xf3n entonces hostil y habitada por comunidades ind\xedgenas.",null,B.cv,B.am,null,null,null,null,null)
